import { BrowserRouter, Routes, Router  } from 'react-router-dom'
import Main from './main/main';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Main></Main>
      <Routes>
        <Router path='/'></Router>
        <Router path='/create'></Router>
        <Router path='/delect'></Router>
        <Router path='/update'></Router>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
